import React from "react";
import {Link} from "react-router-dom"
import { useState, useContext } from "react";
import { useNavigate } from "react-router-dom";
import { AppContext } from "../Context";



function Header2({setCatSelected}) {

  const {isLogged} = useContext(AppContext)

  const navRoute = (e) => {
    e.preventDefault();
    let name = e.target.name
    if(!isLogged){
      navigate("/login")
    }

  }


  return (
    <div className="header-2">
        <Link to="/">
          <button className="nav-buttons">translate</button>
        </Link>
        {/* <Link to="/expressions"> */}
          <button name="expressions" className="nav-buttons" onClick={(e) => navRoute(e)}>expressions</button>
        {/* </Link> */}
        <Link to="/words">
         <button name="words" className="nav-buttons">words</button>
        </Link>
        <Link to="/stars">
        <button name="stars" className="nav-buttons" onClick={()=> setCatSelected(false)}>stars</button>
        </Link>
    </div>
  )
}

export default Header2;
